INSERT INTO `berita` (`id_berita`, `id_user`, `tanggal_tambah`, `gambar`, `judul`, `isi`) VALUES
(7, 5, '2020-12-27 15:24:26', 'krisan.jpg', 'Krisan Asal Kota Solok Tetap Eksis di Tengah Pandemi', '<p>Solok &ndash; Di tengah pandemi Covid-19 yang melanda tanah air, beberapa sektor pertanian khususnya sektor tanaman hias atau florikultura terkena imbasnya. Lesunya pasar bunga yang terjadi di beberapa wilayah di Indonesia membuat perekonomian para petani florikultura tidak berjalan dengan optimal.</p><p>Direktur Buah dan Florikultura, Direktorat Jenderal Hortikultura Kementan, Liferdi Lukman mengungkapkan jika pasar florikultura sedikit meredup. Misalnya saja bunga dan daun potong yang memang sifat komoditasnya memiliki vaselife.</p><p>&ldquo;Masa kesegarannya terbatas. Sekitar dua Minggu,&rdquo; ungkap Liferdi melalui keterangan, Selasa (9/6).</p><p>Menurut Liferdi, kondisi ini mengharuskan pelaku usaha florikultura untuk lebih kreatif dalam melakukan inovasi. Sesuai arahan Menteri Pertanian, Syahrul Yasin Limpo (SYL), meminta seluruh elemen masyarakat untuk bahu membahu mendorong inovasi di bidang pertanian.</p><p>Liferdi lantas mencontohkan Kabupaten Banjar. Mereka membuat hand sanitizer berbahan baku melati. Pun di Kabupaten Cianjur, para petani berinisiatif menggelar bazaar krisan di perkantoran dan membagikan karangan bunga untuk para paramedis sebagai ungkapan terimakasih.</p><p>Liferdi menambahkan bahwa hal yang sama dilakukan oleh petani krisan di Kota Solok. Mereka mensiasati pemasaran bunga krisan dengan tetap mematuhi aturan social distancing.</p><p>&ldquo;Penjualan dilakukan melalui media sosial secara online dan door to door ke rumah warga. Mereka melayani pemesanan krisan dengan sistem pesan antar, sehingga warga tidak perlu keluar rumah untuk membeli tanaman krisan,&rdquo; beber dia.</p><p>Adapun pengembangan krisan utama di Provinsi Sumatera Barat berada di Kota Solok, dan Kab. Solok. Sedangkan untuk Kab. Tanahdatar dan Kab. Agam masih dalam pengembangan karena iklimnya cocok untuk kawasan krisan.</p><p>&ldquo;Dalam mendorong pengembangan agribisnis krisan di Kota Solok, Direktorat Jenderal Hortikultura mengalokasikan pengembangan kawasan krisan seluas 1.000 meter persegi pada Tahun 2020,&rdquo; tutup Liferdi.</p><p>*_Permintaan Meningkat_*</p><p>Dikonfirmasi terpisah, Zulkifli Ishaq dari Pemda Kota Solok mengatakan bahwa tidak ada masalah dengan permintaan bunga krisan dalam kondisi pandemi ini. Bahkan permintaan krisan pot dalam tempo 1 minggu habis 500 pot dibeli warga.</p><p>&ldquo;Luas lahan krisan saat ini untuk Kota Solok sekitar 500 meter persegi dalam Green House dan 100 meter persegi di pekarangan masyarakat/swadaya. Bukan merupakan kawasan yang cukup luas namun mereka sudah bisa meningkatkan ekonomi masyarakatnya&rdquo; jelas Zulkifli.</p><p>Zulkifli menambahkan bahwa selama Pandemi Covid 19 ini pemasaran bunga krisan hanya di sekitar Kota Solok. Dalam situasi normal biasanya pemasaran mencapai wilayah Provinsi Sumatera Barat, seperti Kota Padang, Kota Payakumbuh, Kota Padang Panjang dan Kab/Kota lainnnya dalam Provinsi Sumatera Barat, kata dia.</p><p>&ldquo;Bunga Krisan di Kota Solok dijual dalam bentuk krisan pot dan krisan potong. Untuk harga krisan pot sekitar Rp20 ribu rupiah/pot dan krisan potong dengan harga dua ribu /tangkai,&rdquo;tambahnya.</p><p>Menurut Zulkifli dalam keadaan pandemi ini yang terkena imbasnya adalah Kawasan wisata agro Payo atau yang lebih dikenal dengan Agrowisata Payo di Kota Solok. Selama pandemi Covid-19 kawasan ini sepi pengunjung karena adanya larangan keluar rumah oleh Pemerintah.</p><p>&ldquo;Biasanya pengunjung yang datang berasal dari dalam maupun luar kota, seperti Aceh, Sumatera Utara, Riau, Jambi, serta perantau dari Jakarta. Banyak juga yang dari pengunjung tersebut yang membeli tanaman krisan sebagai oleh-oleh, biasanya terjual sekitar 20-30 tangkai,&rdquo; terangnya.</p><p>Agrowisata Payo sendiri adalah salah satu Kawasan Agrowisata terpadu dengan ikon bunga Krisan dan merupakan kebanggaan dari Kota Solok. Kawasan Agrowisata Payo berdiri pada tanggal 5 Desember 2018 dan diresmikan oleh Direktur Jenderal Hortikultura.</p><p>Kawasan ini berada pada ketinggian 900m dpl sehingga sangat cocok untuk pengembangan Kawasan krisan dan tanaman hias lainnya, kata pria asli Minang ini.</p><p>&ldquo;Kami berharap kondisi pandemi ini segera berlalu, agar bisnis florikultura dan perekonomian di Kabupaten Solok kembali menggeliat,&rdquo;pungkasnya</p>'),
(8, 5, '2020-12-27 15:26:26', 'mangga.jpg', 'Trik Petani Mangga Kendalikan Lalat Buah di Tengah Pandemi Corona', '<p>Indramayu &ndash; Rerimbunan pohon mangga Gedong gincu di Desa Krasak, Indramayu, Jawa Barat terasa menyejukkan bagi siapapun yang memandang. Waryana, ketua kelompok Tani Angling Darma, pagi-pagi sekali sudah berkeliling menggunakan sepeda motornya untuk &ldquo;menginspeksi&rdquo; populasi lalat buah yang terperangkap.</p><p>Hasil perangkap lalat buah yang terpasang sejak setahun lalu itu selalu dimonitor olehnya setiap sepekan sekali. Meski wabah corona melanda tak menyurut langkah Waryana untuk mengelola Kebun nya.</p><p>&ldquo;Bagi saya, monitoring lalat buah sudah menjadi kewajiban layaknya seorang prajurit dalam situasi perang,&rdquo; ujar Waryana dalam keterangannya saat dihubungi Sabtu (6/6)</p><p>Desa Krasak merupakan salah satu lokasi penerapan pengendalian lalat buah di Indonesia, kerjasama pemerintah Indonesia dan Australia. Sebanyak 10 perangkap lalat buah telah terpasang di lahan seluas 40 ha tersebut.</p><p>Waryana memaparkan, Direktorat Perlindungan Hortikultura dan Balai Penelitian Buah Tropika (Balitbu) bersama Australian Centre for International Agricultural Research (ACIAR) telah memilih Desa Krasak sebagai salah satu lokasi pengendalian lalat buah. Alhasil selama setahun berjalan, populasi lalat buah menurun drastis.</p><p>&ldquo;Artinya, potensi pengembangan mangga Gedong gincu sebagai komoditas unggulan cukup baik dan berpeluang layak ekspor,&rdquo; beber dia.</p><p>Kementerian Pertanian dibawah komando Syahrul Yasin Limpo (SYL) tetap mendorong dan memacu jajaran di Kementan untuk lebih giat dalam penerapan teknologi pengelolaan OPT. Tujuannya agar ketersediaan mangga dapat memenuhi kebutuhan rakyat Indonesia. Bahkan dapat diekspor ke negara lain.</p><p>Sejalan dengan hal tersebut Direktur Jenderal Hortikultura, Prihasto Setyanto menyampaikan bahwa salah satu kunci keberhasilan produksi mangga yaitu dengan melakukan monitoring populasi lalat buah. Termasuk implementasi metode pemasangan perangkap.</p><p>&ldquo;Karena ini menjadi salah satu alternatif pengendalian lalat buah yang ramah lingkungan dimana biaya produksi menjadi lebih rendah. Petani tidak harus membeli pestisida mahal harganya dan produk mangga yang dihasilkan juga lebih sehat,dan aman dikonsumsi, &rdquo; jelasnya</p><p><strong>Populasi Lalat Menurun Drastis</strong></p><p>Menurut Affandi, peneliti senior Balitbu, populasi lalat buah di Desa Krasak menurun secara drastis dalam waktu yang relatif singkat. Dia menegaskan bahwa peran petani sangat sginifkan.</p><p>&ldquo;Pak Waryana, seorang yang sangat aktif, semangat, dan ulet,&rdquo; ujarnya saat meninjau lahan bersama Tim Aciar di Desa Krasak.</p><p>Hal senada disampaikan Andi Abdurahim, staf fungsional POPT Direktorat Perlindungan Hortikultura. Dia mengatakan bahwa Waryana telah membuktikan kebun mangga di Desa Krasak sebagai lahan yang tepat untuk pengendalian lalat buah.</p><p>Sementara, Direktur Perlindungan Hortikultura, Sri Wijayanti Yusuf menjelaskan pengendalian lalat buah bukanlah program sesaat. Kegiatan ini merupakan aktivitas berkelanjutan, dan mendukung&nbsp;<em>sustainable agriculture</em></p><p>&ldquo;Pengendalian lalat buah harus dapat dilakukan secara berkelanjutan oleh pemerintah bersama masyarakat, petugas, dan petani,&rdquo; kata Yanti.</p><p>&ldquo;Diharapkan metode pengendalian lalat buah di Desa Krasak menjadi percontohan bagi siapapun yang akan menerapkan aktivitas yang sama,&rdquo; pungkasnya.</p>'),
(9, 5, '2020-12-27 15:27:04', 'cabai.jpg', 'Komoditas Cabai Punya Prospek Cerah, Kuncinya Penerapan Inovasi', '<p>Jakarta &ndash; Pengembangan industri komoditas hortikultura amat menjanjikan. Pasalnya, buah-buahan maupun sayuran dikonsumsi setiap hari oleh jutaan masyarakat. Salah satunya adalah cabai. Sebagai komoditas strategis hortikultura, prospek &lsquo;si pedas&rsquo; sejatinya amat menggiurkan.</p><p>Tak hanya dijadikan bahan bumbu utama masyarakat Indonesia, cabai juga bisa dikreasikan menjadi produk olahan bernilai ekonomi tinggi. Ini yang kemudian menjadi tantangan para petani, pelaku agrobisnis hingga agro industri.</p><p>Demikian intisari webinar bertajuk &lsquo;Gedor Horti (Gerakan Mendorong Produksi, Daya Saing dan Ramah Lingkungan Hortikultura)&rsquo; in Action, yang diselengarakan Direktorat Jenderal Hortikultura Kementerian Pertanian (Kementan), Sabtu (6/6).</p><p>Sekretaris Direktorat Jenderal Hortikultura Kementan, Retno Sri Hartati Mulyandari mengatakan bahwa produksi cabai nasional amat melimpah. Berdasar data yang dilansir Direktorat Pengolahan dan Pemasaran Hasil Hortikultura, kebutuhan konsumsi cabai besar saja mencapai 254.670 ton per bulan dengan produksi 281.712 ton atau surplus 27.042 ton.</p><p>&ldquo;Artinya stok cabai selalu mencukupi. Persoalannya sekarang adalah bagaimana mengoptimalkan pola distribusinya. Bagaimana satu daerah yang surplus, bisa menyuplai daerah yang minus dari sisi produksi,&rdquo; ujar Retno.</p><p>Menurut Retno, ketika aspek distribusi bisa benar-benar optimal, maka stok dan harga terjaga stabilitasnya. Ini sebagaimana arahan Menteri Pertanian Syahrul Yasin Limpo (SYL). Tinggal kemudian digenjot untuk skala agrobisnis dan agro industri.</p><p>&ldquo;Maka dari itu dengan keberadaan Early Warning System (EWS) yakni sistem informasi mengenai ketersediaan stok komoditas hortikultura jelas sangat membantu,&rdquo; lanjut dia.</p><p>Sementara Kepala Balai Besar Penelitian Pengembangan Pascapanen, Prayudi Syamsuri mengatakan bahwa pengolahan, inovasi teknologi pasca panen cabai penting dilakukan. Tak melulu meningkatkan sektor ekonomi, tetapi juga meminimalisir nilai kehilangan hasil panen (food losses).</p><p>Prayudi lantas mengungkapkan, kehilangan pasca panen komoditas cabai sekitar 18,8 persen. Sementara untuk produksi cabai nasional sendiri mencapai 2.559.000 ton per tahun. &ldquo;Artinya kehilangan potensi konsumsinya sekitar 276.000 ton pertahun,&rdquo; jelas dia.</p><p>Maka dari itu, inovasi teknologi pascapanen pertanian pada cabai menjadi sebuah keniscayaan.</p><p>&ldquo;Untuk cabai kita punya teknologi ozonisasi, CAS, modified atmospher storage. Untuk teknologi pengolahan cabai, ada juga minyak cabai, cabai kering, hingga cabai in brine,&rdquo; sambung Prayudi.</p><p>Dia menambahkan bahwa potensi ekonomi cabai amat besar. Tak hanya buahnya, cabai memiliki banyak sekali bagian yang diolah. Mulai dari daun, batang, akar hingga biji atau cabai segar.</p><p>&ldquo;Lebih dari 20 varian produk dengan nilai tambah cukup baik yang bisa diolah dari cabai. Pupuk hayati, bubuk cabai, abon cabai, pasta cabai, minyak cabai, farmasi, dan masih banyak lagi,&rdquo; kata Prayudi.</p><p>Prayudi optimis bahwa prospek industri pengolahan cabai nasional bakal melejit. Maka dari itu butuh sinergi semuah pihak agar implementasi penerapan teknologi pascabudidaya semakin masif.</p><p>&ldquo;Balai Besa Penelitian Pengembangan Pascapanen membuka diri bagi siapapun yang ingin belajar. Silakan datang, kami siap sharing hasil-hasil penelitian kami,&rdquo; pungkasnya.</p><p>Saat mengunjungi lahan, Bupati Tegal Umi Azizah mengatakan bahwa fluktuasi harga cabai segar memang menjadi PR yang tiada hentinya. Utamanya saat pandemi Covid 19 di mana banyak horeka yang tidak beroperasi termasuk penerapan PSBB yang mempersulit distribusi cabai.</p><p>&ldquo;Meskipun demikian, hal ini tidak akan menyurutkan semangat tanam para petani. Petani memiliki mental pejuang. Ketika harga hari ini turun, petani tetap semangat dengan keyakinan di masa depan harga akan membaik,&rdquo; ujarnya.</p><p>Penyelenggaraan bimtek olahan cabai online yang menyedot perhatian hampir 1200 peserta yang menginput daftar absensi dan dengan angka tertinggi di ruang virtual sebanyak hampir 800 node ini membuktikan besarnya animo masyarakat, pengusaha, penyuluh, dan petani untuk mengembangkan bisnis cabai olahan.</p><p>&ldquo;Saya kira pasarnya luas ya, tidak hanya ibu &ndash; ibu muda. Jaman sekarang orang lebih suka yang praktis. Ini prospek bisnis menjanjikan,&rdquo; tambahnya.</p><p>Direktur Pengolahan dan Pemasaran Hasil Hortikultura, Bambang Sugiharto selanjutnya mengatakan bahwa sisi pengembangan olahan cabai adalah salah satu perhatian Kementerian Pertanian.</p><p>&ldquo;Kami siap mendampingi dari sisi bimteknya termasuk stimulan kelengkapan usahanya. Petani dapat berkomunikasi dengan dinas pertanian setempat. Poin pentingnya adalah komitmen petani untuk terus berproduksi. Jangan sampai nanti permintaan banyak, produksinya turun atau barangnya tidak ada karena petani berganti komoditas. Jadi ayo bertani karena bertani itu keren,&rdquo; jelas Bambang.</p><p>Direktur Perlindungan Sri Wijayantie Yusuf juga turut mengingatkan agar petani menerapkan budidaya ramah lingkungan dengan menggunakan biopestisida agar hasil tanaman berkualitas dan aman konsumsi.</p><p>&ldquo;Cabai belum bisa ekspor karena penggunaan pestisida. Maka kami arahkan petani untuk menggunakan biopestisida agar hasil tanaman berkualitas dan aman konsumsi tentunya,&rdquo; ujarnya.</p>'),
