INSERT INTO `informasi` (`id_info`, `id_user`, `tanggal_tambah`, `jenis`, `nama_komoditas`, `deskripsi_komoditas`, `gambar_komoditas`, `persiapan`, `pembibitan`, `penanaman`, `pemeliharaan`, `obat_pertanian`) VALUES
(43, 5, '2020-12-27 14:55:04', 'Sayur', 'Cabe Merah', '<p>Cabai atau cabai merah atau lombok adalah buah dan tumbuhan anggota genus Capsicum. Buahnya dapat digolongkan sebagai sayuran maupun bumbu, tergantung bagaimana digunakan. Sebagai bumbu, buah cabai yang pedas sangat populer di Asia Tenggara sebagai penguat rasa makanan.</p>', 'cabai.jpg', '<p>Lahan yang diperlukan untuk budidaya cabe merah adalah tanah yang gembur dan memiliki porosotas yang baik. Sebelum cabe merah ditanam cangkul atau bajak lahan sedalam 20-40 cm. Bersihkan dari batu atau kerikil dan sisa-sisa akar tanaman. Apabila terlalu banyak gulma dan khawatir menganggu bisa gunakan herbisida.</p><p>Buat bedengan dengan lebar satu meter tinggi 30-40 cm dan jarak antar bedengan 60 cm. Panjang bedengan disesuaikan dengan kondisi lahan, untuk memudahkan pemeliharaan panjang bedengan maksimal 15 meter. Buat saluran drainase yang baik karena tanaman cabe merah tidak tahan terhadap genangan air.</p><p>Budidaya cabe merah menghendaki tanah yang memiliki tingkat keasaman tanah pH 6-7. Apabila nilainya terlalu rendah (asam), daun tanaman cabe merah akan terlihat pucat dan mudah terserang virus. Tanah yang asam biasanya mudah ditumbuhi ilalang. Untuk menetralisirnya bisa gunakan kapur pertanian atau dolomit sebanyak 2-4 ton/ha. Pemberian kapur atau dolomit dilakukan pada saat pembajakan dan pembuatan bedengan.</p><p>Campurkan pupuk organik, bisa berupa kompos&nbsp;atau&nbsp;<a href=\"https://alamtani.com/pupuk-kandang.html\">p</a>upuk kandang&nbsp;pada setiap bedengan secara merata. Kebutuhan pupuk organik untuk budidaya cabe merah adalah 20 ton per hektar. Selain pupuk organik tambahkan juga urea 350 kg/ha dan KCl 200kg/ha.</p><p>Untuk budidaya cabe intensif sebaiknya, bedengan ditutup dengan mulsa plastik perak hitam. Penggunaan mulsa plastik mempunyai konsekuensi biaya namun mendatangkan sejumlah manfaat. Mulsa bermanfaat untuk mempertahankan kelembaban, menekan erosi, mengendalikan gulma dan menjaga kebersihan kebun.</p><p>Buat lubang tanam sebanyak dua baris dalam setiap bedengan dengan jarak 60-70 cm. Sebaiknya lubang tanam dibuat zig zag, tidak sejajar. Hal ini berguna untuk mengatur sirkulasi angin dan penetrasi sinar matahari. Diameter dan kedalaman lubang tanam kurang lebih 10 cm, atau disesuaikan dengan ukuran polybag semai.</p>', '<p>Benih untuk budidaya cabe bisa didapatkan dengan dua cara, yaitu membeli di toko benih atau membenihkan sendiri. Benih cabe hibrida sebaiknya dibeli dari industri benih terpercaya yang menerapkan teknologi pemuliaan moderen. Sedangkan benih cabe lokal bisa didapatkan dari sesama petani atau menyeleksi sendiri dari hasil panen terdahulu.</p><ol><li><p>Siapkan campuran tanah, arang sekam dan kompos atau pupuk kandang dengan perbandingan 2:1:1. Atau, kalau tidak ada arang sekam gunakan tanah dan kompos dengan perbandingan 1:1. Sebelum dicampur, media tersebut diayak agar halus. Untuk lebih detail, silahkan baca cara&nbsp;<a target=\"_blank\" href=\"https://alamtani.com/media-persemaian-hortikultura.html\">membuat media persemaian</a>.</p></li><li><p>Sebaiknya buat naungan untuk tempat penyemaian untuk menghindari terik matahari dan air hujan. Apabila ada biaya, ada baiknya melindungi tempat penyemaian dengan jaring pelindung hama atau serangga. Susun polybag yang telah diisi media semai dalam naungan tersebut.</p></li><li><p>Rendam biji cabe dengan air hangat selama kurang lebih 3 jam. Jangan gunakan biji yang mengapung. Masukkan setiap biji cabe kedalam polybag sedalam 0,5 cm dan tutup dengan kompos halus. Basahi sedikit media tanam agar kelembabannya terjaga.</p><p>Siram polybag pembibitan setiap pagi dan sore hari. Cara menyiramnya adalah tutup permukaan polybag dengan kertas koran kemudian siram hingga basah. Buka kertas koran tersebut setelah biji tumbuh kira-kira 3 sekitar hari.</p></li><li><p>Selanjutnya siram secara rutin dan awasi pertumbuhannya. Bibit cabe merah siap untuk dipindahkan setelah 21-24 hari disemaikan atau setelah tumbuh 3-4 helai daun. Lebihkan 10% dari kebutuhan bibit. Misalnya untuk lahan satu hektar dibutuhkan sekitar 14000 bibit cabe merah, maka lebihkan 10 persen untuk tindakan penyulaman tanaman.</p></li></ol>', '<p>Pemindahan bibit cabe merah dari area persemaian dilakukan setelah umur bibit sekitar 3 minggu atau bibit memiliki 3-4 helai daun permanen. Penanaman sebaiknya dilakukan pada pagi hari dan sore hari untuk menghindari stress. Usahakan penanaman dilakukan serentak dalam satu hari.</p><p>Cara menanamnya adalah dengan membuka atau menyobek polybag semai. Kemudian masukkan bibit cabe merah beserta media tanamnya kedalam lubang tanam. Jaga agar media semai jangan sampai terpecah. Kemudian siram tanaman secukupnya untuk mempertahankan kelembaban.</p>', '<p>Penyiraman diperlukan pada saat musim kering, caranya bisa dengan gembor atau dengan penggenangan. Hati-hati ketika melakukan penyiraman disaat tanaman belum terlalu kuat. Penggenangan bisa dilakukan setiap dua minggu sekali.</p><p>Periksa tanaman pada satu sampai dua minggu pertama untuk melakukan penyulaman tanaman. Apabila ada tanaman yang mati atau pertumbuhannya abnormal segera cabut dan ganti dengan bibit yang baru.</p><p>Pada budidaya cabe memerlukan pemasangan ajir (tongkat bambu) untuk menopang tanaman berdiri tegak. Tancapkan ajir dengan jarak mnimal 4 cm dari pangkal batang. Pemasangan ajir sebaiknya dilakukan pada hari ke-7 sejak bibit dipindahkan. Apabila tanaman terlalu besar dikhawatirkan saat ajir ditancapkan akan melukai perakaran. Bila akar terluka tanaman akan akan mudah terserang penyakit. Pengikatan tanaman pada ajir dilakukan setelah tanaman tumbuh tinggi atau berumur diatas satu bulan.</p><p>Perempelan atau pemotongan tunas dilakuan setelah 3 minggu untuk budidaya cabe di dataran rendah dan 1 bulan untuk dataran tinggi. Potong tunas yang tumbuh pada ketiak daun dengan tangan yang bersih. Perempelan ini dilakukan sampai terbentuk cabang utama, ditandai dengan kemunculan bunga pertama atau kedua.</p><p>Pemupukan susulan dilakukan setiap dua minggu sekali atau minimal 8 kali hingga panen terakhir. Pemupukan susulan dilakukan dengan pengocoran pupuk pada setiap lubang tanam. Pemupukan yang paling praktis adalah dengan menggunakan pupuk organik cair. Siramkan 100 ml larutan pupuk yang telah diencerkan pada setiap tanaman. Bisa juga ditambahkan NPK pada campuran tersebut.</p><p>Penyiangan gulma dilakukan apabila diperlukan saja. Pengendalian hama dan penyakit dalam budidaya cabe cukup vital. Banyak kasus budidaya yang gagal karena serangan hama dan penyakit. Untuk lebih detail, silahkan baca pengendalihan hama dan penyakit</p>', '<p>Jenis-jenis pestisida yang dapat digunakan untuk tanaman cabe merah:</p><ul><li>Fungisida</li><li>Akarisida</li><li>Insektisida</li><li>Bakterisida</li><li>Nematisida</li><li>Pupuk Daun / Pupuk Cair</li><li>ZPT (Zat Pengatur Tumbuh)</li></ul>'),
(44, 5, '2021-04-11 13:37:31', 'Sayur', 'Sawi', '<p>Sawi adalah sekelompok tumbuhan&nbsp; yang dimanfaatkan daun atau bunganya sebagai bahan pangan, baik segar maupun diolah.&nbsp;Berdasarkan taksonomi (klasifikasinya), sawi masuk dalam <a target=\"_blank\" href=\"https://lpi.oregonstate.edu/mic/food-beverages/cruciferous-vegetables\">genus <em>Brassica</em></a> dengan famili sayuran cruciferous. Maksudnya, tanaman ini masih satu famili dengan berbagai macam kubis-kubisan yang mengandung senyawa antikanker.</p>', 'sawi.jpg', '<p>Pengolahan tanah secara umum melakukan penggemburan dan pembuatan bedengan. Tahap-tahap penggemburan yaitu pencangkulan untuk memperbaiki struktur tanah dan sirkulasi udara dan pemberian pupuk dasar untuk memperbaiki fisik serta kimia tanah yang akan menambah kesuburan lahan yang akan kita gunakan.</p><p>Tanah yang hendak digemburkan harus dibersihkan dari bebatuan, rerumputan, semak atau pepohonan yang tumbuh. Dan bebas dari daerah ternaungi, karena tanaman sawi suka pada cahaya matahari secara langsung.</p><p>Sedangkan kedalaman tanah yang dicangkul sedalam 20 sampai 40 cm.&nbsp;Pemberian pupuk kandang fermentasi 3-5 ton/ha. Pupuk kandang fermentasi diberikan saat penggemburan agar cepat merata dan bercampur dengan tanah yang akan digunakan.</p>', '<p>Tanaman sawi tidak bisa kita tanam langsung dari benih karena akan memiliki tingkat kematian yang tinggi. akan tetapi harus kita buat pembibitan terlebih dahulu. Pembibitan dapat dilakukan bersamaan dengan pengolahan tanah untuk penanaman, karena lebih efisien dan benih akan lebih cepat beradaptasi terhadap lingkungannya.</p><p>Ukuran bedengan pembibitan yaitu lebar 80-120 cm dan panjangnya 1-3 meter, tinggi bedengan 20-30 cm.</p><p>Dua minggu sebelum ditabur benih, bedengan pembibitan ditaburi dengan pupuk kandang lalu ditambah 20 gram urea, 10 gram TSP, dan 7,5 gram Kcl.</p><p>Cara melakukan pembibitan yaitu : benih ditabur, lalu ditutupi tanah setebal 1-2 cm, lalu disiram dengan sprayer. Setelah berumur 3-4 minggu sejak disemaikan tanaman dipindahkan ke bedengan.</p>', '<p>Hal terpenting dalam penanaman sawi adalah kedalaman penanaman sawi, tidak boleh terlalu dalam atau terlalu dangkal. Bedengan dengan ukuran lebar 120 cm dan panjang sesuai dengan ukuran petak tanah.</p><p>Tinggi bedeng 20-30 cm dengan jarak antar bedeng 30 cm. Seminggu sebelum penanaman dilakukan pemupukan terlebih dahulu yaitu pupuk kandang 3-5 ton/ha, TSP 40 kg/ha, Kcl 15 kg/ha.</p><p>Jarak tanam dalam bedengan 40 x 40 cm, 30 x 30 dan 20 x 20 cm.&nbsp;</p><p>Pilihlah bibit yang baik, pindahkan bibit dengan hati-hati, lalu membuat lubang dengan ukuran 4 - 8 x 6 -10 cm.</p>', '<p>Pertama-tama yang perlu diperhatikan adalah penyiraman, penyiraman ini tergantung pada musim, bila musim penghujan dirasa berlebih maka kita perlu melakukan pengurangan air yang ada. tetapi sebaliknya bila musim kemarau tiba kita harus menambah air demi kecukupan tanaman sawi yang kita tanam. Bila tidak terlalu panas penyiraman dilakukan sehari cukup sekali sore atau pagi hari.</p><p>Penjarangan dilakukan 2 minggu setelah penanaman. Caranya dengan mencabut tanaman yang tumbuh terlalu rapat.</p><p>Penyulaman ialah tindakan penggantian tanaman lama yang mati dengan tanaman baru, caranya yaitu tanaman yang mati atau terserang hama dan penyakit diganti dengan tanaman yang baru.</p><p>Penyiangan dilakukan 2-4 kali selama masa pertanaman sawi, disesuaikan dengan kondisi keberadaan gulma pada bedeng penanaman. Biasanya penyiangan dilakukan 1 atau 2 minggu setelah penanaman. Apabila perlu, dilakukan penggemburan dan pengguludan bersamaan dengan penyiangan.</p><p>Pemupukan tambahan diberikan setelah 3 minggu tanam, yaitu dengan urea 20 kg/ha 1 minggu sekali sampai masa panen.</p>', '<p><strong>MOSA BN / TOP BN</strong>&nbsp;</p><p>Ulat&nbsp;<em>Plutella</em>&nbsp;menyerang tanaman dengan memakan bagian epidermis / daging daun. Daun yang sering dimakan adalah daun muda sebelah bawah. Bagian yang tidak dimakan adalah tulang daun dan bagian epidermis sebelah atas. Ulat&nbsp;<em>Plutella</em>&nbsp;sangat merugikan budidaya kobis, kobis bunga, dan brokoli. Pengendalian hama dilakukan dengan penggunaan agens hayati&nbsp;<strong>MOSA BN / TOP BN</strong>&nbsp;dengan bahan aktif jamur&nbsp;<em>Beauveria bassiana</em>&nbsp;dan&nbsp;<em>Nomuraea rileyi</em>. Jamur ini bersifat entomopathogenik terhadap hama ulat&nbsp;<em>Plutella.</em></p><p>&nbsp;</p><p><strong>MOSA GLIO / SUPER GLIO</strong></p><p>Penyakit akar Gada didebabkan oleh jamur&nbsp;<em>Plasmodiophora brassicae</em>&nbsp;Wor. Akar yang terinfeksi mengadakan reaksi dengan pembelahan dan pembesaran sel, yang menyebabkan terjadinya bintil atau kelenjar yang tidak teratur. Rusaknya susunan jaringan akar menyebabkan rusaknya jaringan pengangkutan, sehingga pengangkutan air dan hara tanah terganggu. Penyakit Akar Gada dikendalikan dengan agens hayati&nbsp;<strong>MOSA GLIO / SUPER GLIO</strong>&nbsp;dengan bahan akif jamur&nbsp;<em>Gliocladium</em>&nbsp;sp dan&nbsp;<em>Trichoderma harzianum</em>. Pengendalian dilakukan saat sebelum tanam yaitu dipersemaian / pembibitan dan saat awal tanam bersamaan penebaran pupuk kandang.</p><p>&nbsp;</p><p><strong>BIO SPF</strong>&nbsp;</p><p>Penyakit busuk basah {soft rot) disebabkan oleh bakteri Erwinia carotovora pv. Carotovora (Jones) Dye. Gejala&nbsp; berupa busuk basah berwarna coklat atau kehitaman pada daun, batang dan umbi. Jika kelembaban tinggi jaringan yang sakit tampak kebasahan, berwarna krem atau kecoklatan dan tampak agak berbutir butir halus. Penyakit busuk basah bakteri dikendakan dangan&nbsp;<strong>BIO SPF</strong>&nbsp;dengan bahan aktif bakteri Pseudomonas fluorescent<strong>&nbsp;.</strong></p>'),
(45, 5, '2021-04-11 13:47:09', 'Sayur', 'Tomat', '<p><em>Tomat</em>&nbsp;(Lycopersicum Esculentum) merupakan salah satu produk hortikultura yang berpotensi, menyehatkan dan mempunyai prospek pasar cukup besar.&nbsp;Tomat adalah tumbuhan dari keluarga Solanaceae, tumbuhan asli Amerika Tengah dan Selatan, dari Meksiko sampai Peru. Tomat merupakan tumbuhan siklus hidup singkat, dapat tumbuh setinggi 1 sampai 3 meter.</p>', 'tomat1.jpg', '<p><strong>PENGOLAHAN LAHAN</strong></p><p>Pengolahan tanah untuk tanaman tomat dilakukan dengan melakukan pembersihan lahan dari tanaman-tanaman liar dan pembajakan tanah. Pembajakan tanah dilakukan dengan menghancurkan bongkahan-bongkahan tanah sehingga menjadi lebih halus dan lebih gembur. Pada saat ini, dengan perkembangan mekanisasi pertanian pengolahan tanah semakin mudah untuk dilakukan.</p><p>&nbsp;</p><p><strong>PEMBEDENGAN</strong></p><p>Setelah melakukan pengolahan tanah, Proses berikutnya adalah membuat bedengan. Dengan adanya bedengan, dapat memudahkan dalam melakukan pemeliharaan tanaman tomat. Selain itu dengan bedengan, tanaman tomat terhindar dari genangan ketika terjadi hujan, dengan lebar bedengan 100 cm&nbsp;panjang disesuaikan &nbsp;dengan kondisi tanah, tinggi bedengan kurang lebih 20cm, dan jarak antar bedengan sekitar 100 cm.</p><p>&nbsp;</p><p><strong>PEMUPUKAN</strong></p><p>Pemberian pupuk kandang diberikan dengan cara diratakan di&nbsp;atas tanah bedengan. Pupuk kandang selain dapat memperbaiki sifat biologis tanah juga dapat memperbaiki sifat kimia dan fisik tanah, pupuk kandang juga perlu diberikan pada tanaman sayuran yang banyak mengkonsumsi nitrogen sehingga nitrogen sangat menentukan kuantita dikonsumsi pada fase vegetatif . Pemberian pupuk Organik SP 36, ZA, KCL dengan perbandingan 1:1:&frac12; berfungsi untuk penyanter tanaman vegetatif, cara pemupukan dengan meratakan diatas bedengan dengan jarak per 1 m dan diberikan 100 gr.</p><p>&nbsp;</p><p><strong>PEMASANGAN MULSA</strong></p><p>Bedengan yang sudah jadi kemudian ditutup dengan plastik mulsa hitam perak. Pemasangan plastik ini bertujuan untuk menjaga kelembaban tanah serta mencegah tumbuhnya tanaman pengganggu. Setelah dipasang, diamkan dulu selama 5-10 hari sebelum ditanam.</p>', '<p>Pilih buah tomat yang sehat atau tidak cacat yang akan dijadikan benih. Kemudian biarkan buah tomat tersebut menua di pohon. Setelah cukup tua ambil bijinya dan bersihkan dari lendir yang menyelubunginya dengan air. Setelah itu rendam dalam air, pilih biji yang tenggelam. Kemudian lakukan seleksi sekali lagi terhadap biji tomat, pilih yang bentuknya sempurna (tidak cacat atau keriput). Setelah itu keringkan dengan dijemur dan simpan dalam wadah yang kering dan steril.</p>', '<p>Apabila lahan sudah siap, maka bibit dapat segera ditanam. Yang perlu diperhatikan dalam penanaman adalah &nbsp;waktu tanam dan jarak tanam. Waktu tanam berkaitan erat dengan iklim. Ada tanaman yang cocok ditanam di musim penghujan, sedangkan Jarak tanam disesuaikan dengan morfologi tanaman dan tingkat kesuburan tanahnya. Mengatur jarak tanam berarti memberi ruang lingkup hidup yang sama/merata bagi setiap tanaman. Dengan mengatur jarak &nbsp;tanam ini akan diperoleh barisan-barisan tanaman yang teratur sehingga mudah dalam melakukan pengelolaan tanaman selanjutnya.</p><p>Bibit yang sudah siap tanam dicabut dari persemaian beserta akarnya. Jika bibit berasal dari persemaian plastik atau tray, saat umur 25-30 hari setelah semai bibit dapat langsung ditanam pada lubang tanam dengan jarak 60x70 cm. Saat yang paling tepat untuk penanaman tomat adalah 2-4 minggu sebelum hujan terakhir. Penanaman dilakukan pada sore hari agar tanaman tidak layu dan dapat beradaptasi pada lahan yang ditanami</p>', '<p>Tanaman tomat cukup sensitif dan perlu perawatan yang intensif. Tanaman ini sangat rentan terhadap hama dan penyakit.&nbsp;</p><ol><li>Setelah pemanenan, resiko kerusakan buah tomat masih tinggi sekitar 20 &ndash; 50%. Beberapa hal yang harus dilakukan dalam perawatan tanaman tomat, yaitu :</li></ol><ul><li>Penyulaman, dilakukan untuk mengganti tanaman yang gagal tumbuh.</li><li>Penyiangan, biasanya dilakukan 3 &ndash; 4 kali selama musim tanam. Pada areal tanam yang ditutup mulsa penyiangan bisa lebih jarang lagi. Penyiangan bertujuan untuk mengangkat gulma yang ada di areal tanam.</li><li>Pemangkasan, dilakukan setiap minggu. Pemangkasan tunas yang tumbuh pada ketiak daun harus segera agar tidak tumbuh menjadi batang. Pemotongan ujung tanaman dilakukan setelah terlihat jumlah dompolan buah sekitar 5 &ndash; 7 buah.</li><li>Pemupukan tambahan, dengan menyemprotkan pupuk organik cair yang mempunyai kandungan kalium tinggi pada saat tanaman akan berbunga dan berbuah (fase generatif). Penyemprotan bisa dilakukan setiap minggu. Untuk budidaya tomat non-organik, pada usia satu minggu berikan campuran urea dan KCl dengan perbandingan 1:1 sebanyak 1 &ndash; 2 gram per tanaman. Kemudian setelah umur 2 &ndash; 3 minggu berikan kembali urea dan KCl sebanyak 5 gram per tanaman. Bila pada umur lebih dari 4 minggu tanaman masih terlihat kurang gizi, berikan urea dan KCl sebanyak 7 gram per tanaman. Perhatikan, pemberian urea dan KCl jangan sampai mengenai tanaman karena bisa melukai tanaman tersebut..</li><li>Penyiraman dan pengairan. Tanaman tomat tidak terlalu banyak membutuhkan air, namun jangan sampai kekurangan. Kelebihan air akan membuat pertumbuhan vegetatif (daun dan batang) yang subur tetapi menghambat fase generatif. Sebaliknya, kekuranga air yang berkepanjangan bisa menyebabkan pecah-pecah pada buah tomat yang dihasilkan. Bila curah hujan cukup maka yang harus diperbaiki adalah saluran drainase agar air tidak menggenang disekitar areat tanaman.</li><li>Pemasangan lenjeran atau ajir, bertujuan untuk mengikat tanaman agar tidak roboh.</li></ul>', '<p><strong>Ulat Buah Tomat&nbsp;</strong></p><p>(a) ngengat tertarik pada cahaya ultraviolet sehingga dengan sinar tersebut diadakan perangkap; (b) telur dan ulat dapat dikumpulkan dan dibakar atau dimatikan; (c) ditepi kebun ditanam jagung untuk mengurangi serangan pada tanaman tomat; (d) tanaman liar disekitar areal pertanaman tomat dibersihkan; (e) disemprot dengan insektisida, misalnya Diazinon dan Cymbush.</p><p>&nbsp;</p><p><strong>Kutu Daun Apish Hijau</strong></p><p>(a) gulma di sekitar areal tanaman tomat harus dibersihkan karena dapat menjadi tempat berlindung kutu; (b) pengendalian secara mekanis dapat dilakukan dengan cara dipijit sehingga kutu aphis tersebut mati; (c) pengendalian secara kimiawi dapat dilakukan dengan penyemprotan insektisida.</p><p>&nbsp;</p><p><strong>Lalat Putih (Kutu Kabut)</strong></p><p>(a) digunakan musuh alami hama, misalnya beberapa jenis tabuhan yang merupakan parasit lalat putih dan beberapa jenis lembing guna memakan telur lalat putih; (b) gulma di sekitar tanaman tomat harus dibersihkan supaya tidak menjadi inang lalat putih; (c) tanaman tomat terserang virus harus segera dicabut dan dibakar; (d) pertanaman tomat dapat diberi mulsa jerami atau mulsa plastik; (e) disemprot dengan Diazinon, Malathion, Azinpos-methyl dan lain-lain.</p><p>&nbsp;</p><p><strong>Kutu Daun Trips</strong></p><p>(a) tanaman yang kekurangan air lebih banyak diserang thrips. Untuk itu, tanaman tomat harus disiram dengan air yang cukup; (b) gulma di areal tanaman tomat harus dibersihkan agar tidak menjadi tempat berlindung thrips; (c) disemprot dengan insektisida, misalnya Diazinon, Malathion dan Monocrotophos.</p><p>&nbsp;</p><p><strong>Lalat Buah</strong></p><p>(a) pada waktu mencangkul, tanah harus dibalik dan dibiarkan beberapa hari sampai beberapa minggu agar terkena sinar matahari sehingga pupa lalat mati; (b) ditangkap dengan menggunakan umpan yang dapat memikat lalat jantan; (c) buah yang terserang segera dipetik dan dibakar; (d) gulma di daerah pertanaman tomat harus selalu dibersihkan.</p><p>&nbsp;</p><p><strong>Nematoda Bengkak Akar</strong></p><p>(a) tanah dicangkul dan dibiarkan beberapa waktu agar terkena sinar matahari; (b) tanah digenangi air yang cukup lama supaya nematoda mati; (c) menggunakan bahan kimia Nematisida, misalnya Furadan, Curater, Petrofur, Indofuran, dan Temik; (d) menanam varietas tomat yang resisten; (e) tanaman yang terserang harus segera dicabut dan dibakar; (f) gulma di areal tamanan tomat dibersihkan; (g) diberi pupuk organik (pupuk kandang atau kompos).</p>'),
