INSERT INTO `informasi_desa` (`id_info`, `Judul`, `Isi`, `Tanggal_post`) VALUES
(7, 'uihfuank', 'jcz dsakjfn fsakl\r\n\r\nUse data attributes to easily control the position of the carousel. data-slide accepts the keywords prev or next, which alters the slide position relative to its current position. Alternatively, use data-slide-to to pass a raw slide index to the carousel data-slide-to=\"2\", which shifts the slide position to a particular index beginning with 0.\r\n\r\nThe data-ride=\"carousel\" attribute is used to mark a carousel as animating starting at page load. If you dont use data-ride=\"carousel\" to initialize your carousel, you have to initialize it yourself. It cannot be used in combination with (redundant and unnecessary) explicit JavaScript initialization of the same carousel.\r\n\r\ngdsajgsgsfjd', '2020-08-12 05:03:58'),
(8, 'desa gondowangi', 'hsdjk', '2020-08-12 05:03:58'),
(9, 'Desa Gondowangi', 'Desa Gondowangi merupakan desa yang terletak di Kecamatan Wagir Kabupaten Malang. Saat ini desa Gondowangi memiliki 5 Dusun, yaitu Gedangan, Dawuhan, Rekesan, Wiloso, Pohbener.', '2020-08-12 05:03:58');
